//===========================================================================
// KNN Inference Functions
//===========================================================================

static inline float knn_euclidean_distance(const float* a, const float* b) {
    float sum = 0.0f;
    for (uint16_t i = 0; i < 8; i++) {
        float d = a[i] - b[i];
        sum += d * d;
    }
    return sqrtf(sum);
}

static inline uint8_t knn_predict(const float* features) {
    // Simple implementation - find K nearest neighbors
    float distances[570];
    uint8_t labels[570];
    
    // Calculate all distances
    for (uint16_t i = 0; i < 570; i++) {
        knn_sample_t sample;
        memcpy_P(&sample, &KNN_SAMPLES[i], sizeof(knn_sample_t));
        distances[i] = knn_euclidean_distance(features, sample.features);
        labels[i] = sample.label;
    }
    
    // Find K nearest (simple selection)
    uint16_t votes[12] = {0};
    for (uint8_t k = 0; k < 3; k++) {
        float minDist = 1e30f;
        uint16_t minIdx = 0;
        for (uint16_t i = 0; i < 570; i++) {
            if (distances[i] < minDist) {
                minDist = distances[i];
                minIdx = i;
            }
        }
        if (labels[minIdx] < 12) votes[labels[minIdx]]++;
        distances[minIdx] = 1e30f; // Mark as used
    }
    
    // Find majority class
    uint8_t best = 0;
    uint16_t maxVotes = 0;
    for (uint8_t i = 0; i < 12; i++) {
        if (votes[i] > maxVotes) { maxVotes = votes[i]; best = i; }
    }
    return best;
}

static inline uint8_t knn_predict_with_confidence(const float* features, float* confidence) {
    float distances[570];
    uint8_t labels[570];
    
    for (uint16_t i = 0; i < 570; i++) {
        knn_sample_t sample;
        memcpy_P(&sample, &KNN_SAMPLES[i], sizeof(knn_sample_t));
        distances[i] = knn_euclidean_distance(features, sample.features);
        labels[i] = sample.label;
    }
    
    uint16_t votes[12] = {0};
    for (uint8_t k = 0; k < 3; k++) {
        float minDist = 1e30f;
        uint16_t minIdx = 0;
        for (uint16_t i = 0; i < 570; i++) {
            if (distances[i] < minDist) { minDist = distances[i]; minIdx = i; }
        }
        if (labels[minIdx] < 12) votes[labels[minIdx]]++;
        distances[minIdx] = 1e30f;
    }
    
    uint8_t best = 0;
    uint16_t maxVotes = 0;
    uint16_t secondVotes = 0;
    for (uint8_t i = 0; i < 12; i++) {
        if (votes[i] > maxVotes) {
            secondVotes = maxVotes;
            maxVotes = votes[i];
            best = i;
        } else if (votes[i] > secondVotes) {
            secondVotes = votes[i];
        }
    }

    // Laplace smoothing plus vote-margin scaling to temper over-confident outputs on OOD inputs
    const float alpha = 0.3f;
    const float denom = (float)KNN_K + alpha * (float)KNN_NUM_CLASSES;
    const float laplaceTop = (maxVotes + alpha) / (denom > 0.0f ? denom : 1.0f);
    float margin = (float)(maxVotes - secondVotes) / (float)KNN_K;
    if (margin < 0.0f) margin = 0.0f;

    *confidence = laplaceTop * (0.5f + 0.5f * margin);
    return best;
}

static inline const char* knn_get_class_name(uint8_t idx) {
    return (idx < 12) ? KNN_CLASS_NAMES[idx] : "unknown";
}

